window.bookSummaryJSON = "<p><b>The guild is under attack, and Van is right in the middle of it all.</b></p> <p>When Master Yewlo is abducted by unknown forces, the Peacemakers are thrown into chaos as the rescue mission begins. Finding Yewlo will be hard, but the search reveals secrets the guild might not survive - secrets about a system so corrupt, it will take Van and his team’s best efforts to untangle the truth.</p> <p>And they might not like what they find.</p> <p>On the grimy station known as Halcyon, Van will track and confront thieves who deal in stolen lives, all in order to save a Master who might not have the guild’s best interest at heart. With Sorcerers and Cloaks and every other kind of criminal, Van, Torina, Perry and Icky learn that friends come in all shapes and sizes - and so do enemies.</p> <p>From the depths of space to Iowa, join Van as he fights to save his guild, free stolen lives, and discover that money makes the universe go around - money and lies, that is.</p> <p>And Van will find the truth, no matter what the cost.</p>"; 
